import './style.css';

import sun_icon from './../../img/icons/sun.svg';
import moon_icon from './../../img/icons/moon.svg';

const Navbar = () => {
    return (
        <nav className="nav">
            <div className="container">
                <div className="nav-row">
                    <a href="/" className="logo"><strong>Freelancer</strong> portfolio</a>

                    <button className="dark-mode-btn">
                        <img src={sun_icon} alt="Light mode" className="dark-mode-btn__icon" />
                        <img src={moon_icon} alt="Dark mode" className="dark-mode-btn__icon" />
                    </button>

                    <ul className="nav-list">
                        <li className="nav-list__item"><a href="/" className="nav-list__link nav-list__link--active">Home</a></li>
                        <li className="nav-list__item"><a href="/projects" className="nav-list__link">Projects</a></li>
                        <li className="nav-list__item"><a href="/contacts" className="nav-list__link">Contacts</a></li>
                    </ul>
                </div>
            </div>
        </nav> 
    );
}
 
export default Navbar;
